document.addEventListener("DOMContentLoaded",(()=>{fetch("/api/teacher-dashboard/",{headers:{Authorization:`Bearer ${localStorage.getItem("token")}`}}).then((e=>e.json())).then((e=>{console.log("Teacher Dashboard:",e)})).catch((e=>console.error("Error fetching teacher dashboard:",e))),fetch("/api/student-dashboard/",{headers:{Authorization:`Bearer ${localStorage.getItem("token")}`}}).then((e=>e.json())).then((e=>{console.log("Student Dashboard:",e)})).catch((e=>console.error("Error fetching student dashboard:",e)))}));